    function approve(
        address spender,
        uint256 amount
    ) public override returns (bool) {
        require(!isBlacklisted[msg.sender], "Sender is blacklisted");
        require(!isBlacklisted[spender], "Recipient is blacklisted");
        super._approve(msg.sender, spender, amount);
        return true;
    }
